import React from 'react';
import { useNavigate } from 'react-router-dom';

const Home = () => {
    const navigate = useNavigate()
    function goToLogin(){
        navigate("/login")
    }
  return (
    <div>
      {/* <Link to="/login">
        <button>Login</button>
      </Link>
      <Link to="/register">
        <button>Register</button>
      </Link> */}
      <button onClick={goToLogin}>Login</button>
    </div>
  );
};

export default Home;
